const quotes = [
    {
        quote: 'Be happy for this moment. This moment is your life.',
        author: 'Omar Khayyam'
    },
    {
        quote: 'You are not a drop in the ocean. You are the entire ocean, in a drop.',
        author: 'Rumi'
    },
    {
        quote: 'You have to keep breaking your heart until it opens.',
        author: 'Rumi'
    },
    {
        quote: 'Raise your words, not your voice. For it is rain that grows flowers, not thunder.',
        author: 'Rumi'
    },
    {
        quote: 'I wish I could show you...the astonishing light of your own being.',
        author: 'Hafez'
    },
    {
        quote: 'The heart is a thousand-stringed instrument that can only be tuned with love.',
        author: 'Hafez'
    }
]

export default quotes;
